import {FaShoppingCart} from "react-icons/fa";
import { NavLink } from "react-router-dom";


const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
      <NavLink to="/">
      <div>
      <img className="https://www.google.com/imgres?imgurl=https%3A%2F%2Ft4.ftcdn.net%2Fjpg%2F03%2F36%2F04%2F41%2F360_F_336044179_qFeu3cWMQYkkT1FJHYN88WFhhKtBus7a.jpg&tbnid=gQRUfewIkYKp8M&vet=12ahUKEwik3tm8o_iDAxWqomMGHXqvBFoQMygoegUIARCpAQ..i&imgrefurl=https%3A%2F%2Fstock.adobe.com%2Fsearch%3Fk%3Dcode%2Blogo&docid=Uf8-gOwvB0yFHM&w=360&h=360&q=codehelp%20logo&ved=2ahUKEwik3tm8o_iDAxWqomMGHXqvBFoQMygoegUIARCpAQ"/>
      </div>
      </NavLink>

        <div>
        <NavLink to="/">
          <p>Home</p>
        </NavLink>
          
          <NavLink tp="/cart">
            <div>
            <FaShoppingCart/>
            </div>
          </NavLink>
          
        </div>
      </div>
    </div>
  )
};

export default Navbar;
